import React from "react";
import styled from "styled-components";

const FooterContainer = styled.footer`
  width: 100%;
  height: var(--footer-height);
  background-color: var(--concept-color2);
  margin-top: var(--margin-default);
  display: flex;
  justify-content: center;
`;

const NavList = styled.nav`
  width: 48%;
  display: flex;
  justify-content: space-between;
`;

const NavItemsContainer = styled.ul`
  font-size: var(--font-size-small-title);
`;

// const NavItemsTitle = styled.ㅇ

const Footer = () => {
  return (
    <FooterContainer>
      <NavList>
        <NavItemsContainer>소개</NavItemsContainer>
        <NavItemsContainer>고객센터</NavItemsContainer>
        <NavItemsContainer>광고</NavItemsContainer>
        <NavItemsContainer>커뮤니티</NavItemsContainer>
      </NavList>
    </FooterContainer>
  );
};

export default Footer;
